    // Complete the maxSubarray function below.
    static long[] maxSubarray(long[] arr) {
        long currentSum = 0l, maxSum = Long.MIN_VALUE;
        long[] seqSums = Arrays.copyOf(arr, arr.length);
        int maxIndex = 0;
        for (int i = 0; i < arr.length; i++) {
            currentSum = Math.max(arr[i], currentSum + arr[i]);
            maxSum = Math.max(maxSum, currentSum);
            for (int j = 0; j < i; j++) {
                seqSums[i] = Math.max(seqSums[i], arr[i] + seqSums[j]);
                if (seqSums[maxIndex] < seqSums[i])
                    maxIndex = i;
            }
        }
        return new long[]{maxSum, seqSums[maxIndex]};
    }

    static long[] maxSubarray2(long[] arr) {
        long currentSum = 0l, maxSum = Long.MIN_VALUE;
        long[] seqSums = new long[arr.length];
        for (int i = 0; i < arr.length; i++) {
            currentSum = Math.max(arr[i], currentSum + arr[i]);
            maxSum = Math.max(maxSum, currentSum);
            if (i == 0) {
                seqSums[i] = arr[i];
            } else {
                if (seqSums[i - 1] < 0 || arr[i] < 0) {
                    seqSums[i] = Math.max(seqSums[i - 1], arr[i]);
                } else {
                    seqSums[i] = Math.max(seqSums[i - 1], arr[i] + seqSums[i - 1]);
                }
            }
        }
        return new long[]{maxSum, seqSums[seqSums.length - 1]};
    }

    static long[] maxSubarray3(long[] arr) {
        long currentSum = 0l, maxSum = Long.MIN_VALUE;
        long[] seqSums = new long[arr.length];
        Arrays.fill(seqSums, Long.MIN_VALUE);
        for (int i = 0; i < arr.length; i++) {
            currentSum = Math.max(arr[i], currentSum + arr[i]);
            maxSum = Math.max(maxSum, currentSum);
        }
        return new long[]{maxSum, subSequenceSum(arr, arr.length - 1, seqSums)};
    }

    static long subSequenceSum(long[] arr, int i, long[] seqSums) {
        // It is possible to apply memoization here
        if (seqSums[i] != Long.MIN_VALUE) return seqSums[i];
        long result;
        if (i == 0) {
            result = arr[i];
        } else {
            long prev = subSequenceSum(arr, i - 1, seqSums);
            if (prev < 0 || arr[i] < 0) {
                result = Math.max(prev, arr[i]);
            } else {
                result = Math.max(prev, arr[i] + prev);
            }
        }
        seqSums[i] = result;
        return result;
    }

    private static final Scanner scanner = new Scanner(System.in);

    public static void main(String[] args) throws IOException {
        BufferedWriter bufferedWriter = new BufferedWriter(new FileWriter(System.getenv("OUTPUT_PATH")));

        int t = scanner.nextInt();
        scanner.skip("(\r\n|[\n\r\u2028\u2029\u0085])?");

        for (int tItr = 0; tItr < t; tItr++) {
            int n = scanner.nextInt();
            scanner.skip("(\r\n|[\n\r\u2028\u2029\u0085])?");

            long[] arr = new long[n];

            String[] arrItems = scanner.nextLine().split(" ");
            scanner.skip("(\r\n|[\n\r\u2028\u2029\u0085])?");

            for (int i = 0; i < n; i++) {
                int arrItem = Integer.parseInt(arrItems[i]);
                arr[i] = (long) arrItem;
            }

            long[] result = maxSubarray2(arr);

            for (int i = 0; i < result.length; i++) {
                bufferedWriter.write(String.valueOf(result[i]));

                if (i != result.length - 1) {
                    bufferedWriter.write(" ");
                }
            }

            bufferedWriter.newLine();
        }

        bufferedWriter.close();

        scanner.close();
    }
